import styled from "styled-components";

export const TelaInicial = styled.html`
  position: relative;
  margin: 0;
  padding: 0;
`;

export const Cabecalho = styled.div`
  background-color: black;
  color: white;
  margin: 0.5%;
  padding: 0.5%;
  font-family: Arial, Helvetica, sans-serif;
  font-size: 0%.3%;
`;

export const divAumento = styled.div`
    position: relative;
    width: 0.5em;
    height: 0.5em;

`;
